function jumpToTab(tabNumber) {
	$('#tabs').tabs('option', 'active', tabNumber);
}

function wCommas(yourNumber) {
	//Seperates the components of the number
	var n = yourNumber.toString().split(".");
	//Comma-fies the first part
	n[0] = n[0].replace(/\B(?=(\d{3})+(?!\d))/g, ",");
	//Combines the two sections
	return n.join(".");
}


function validateEmail(email) {
	var re = /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
	return re.test(email);
}

function getSliderValue() {
	return sliderRef.slider('option', 'value');

}

function calculate_roi(apiMethod) {
	var serializedData = '';
	var roiData = {
		method: apiMethod
	};
	var email_to = $("#form144 #field0").val();

	if (apiMethod == "email") {
		if (validateEmail(email_to)) {
			roiData["email_to"] = email_to;
		} else {
			alert("Email address no valid, please try again");
			return;
		}
		roiInputs = parent.document.getElementsByClassName('roi-input');
		for (var i = 0; i < roiInputs.length; i++) {
			roiInput = roiInputs.item(i);
			roiData[roiInput.name] = roiInput.value;
		}
		roiSliders = parent.document.getElementsByClassName('roi-slider');
		for (var i = 0; i < roiSliders.length; i++) {
			roiSlider = roiSliders.item(i);
			roiSliderHandle = roiSlider.getElementsByClassName('ui-slider-handle').item(0);
			roiData[roiSlider.getAttribute('name')] = parseFloat(roiSliderHandle.getAttribute('handle-value'));
		}
	} else {
		$(".roi-input").each(function() {
			roiData[$(this).attr("name")] = $(this).val();
		});
		$(".roi-slider").each(function() {
			roiData[$(this).attr("name")] = $(this).slider("option", "value");

		});
	}
	$('#form144 #field8').val(roiData['ap_voice']);
	$('#form144 #field9').val(roiData['ap_chat']);
	$('#form144 #field10').val(roiData['ap_email']);
	$('#form144 #field11').val(roiData['ap_social']);
	$('#form144 #field12').val(roiData['sl_aht']);
	$('#form144 #field13').val(roiData['sl_fcr']);
	$('#form144 #field15').val(roiData['aa_agents']);
	$('#form144 #field16').val(roiData['aa_rate']);
	$('#form144 #field17').val(roiData['sl_aai']);
	$('#form144 #field19').val(roiData['cl_customers']);
	$('#form144 #field20').val(roiData['cl_value']);
	$('#form144 #field21').val(roiData['sl_clv']);

	roiData['field_data'] = $('#form144').serialize();

	$.ajax({
		type: 'post',
		url: '/roicalc/_includes/calculator.php',
		data: roiData,
		dataType: 'JSON',
		success: function(roi_results) {
			$('.ap-save').html('$' + wCommas(roi_results.ap_val.toFixed(2)));
			$('.aa-save').html('$' + wCommas(roi_results.aa_val.toFixed(2)));
			$('.cl-save').html('$' + wCommas(roi_results.cl_val.toFixed(2)));
			$('#form144 #field14').val(roi_results.ap_val.toFixed(2));
			$('#form144 #field18').val(roi_results.aa_val.toFixed(2));
			$('#form144 #field22').val(roi_results.cl_val.toFixed(2));

			total_savings = roi_results.ap_val + roi_results.aa_val + roi_results.cl_val;
			$('#form144 #field23').val(total_savings);
			$('#total-savings').html('$' + wCommas(total_savings));

			if (roi_results.email_sent === true) {
				parent.$.colorbox({
					html: "<h3>Your results have been emailed to you.</h3>"
				})
			} else if (roi_results.email_sent === false) {
				parent.$.colorbox({
					html: "<h3>There has been an error, we could not process your request.</h3>"
				})
			} else {
				make_bar_graph(roi_results.ap_val, roi_results.aa_val, roi_results.cl_val);
			}
		}
	});
}

function make_bar_graph(ap_val, aa_val, cl_val) {
	yaxis_max = ap_val + aa_val + cl_val;
	Highcharts.setOptions({
		chart: {
			type: 'column',
			marginTop: 0,
			spacingTop: 0
		},
		exporting: {
			enabled: false
		},
		credits: {
			enabled: false
		},
		title: {
			text: null
		},
		xAxis: {
			categories: ['savings'],
			labels: {
				enabled: false
			}
		},
		yAxis: {
			min: 0,
			title: {
				text: null
			},
			labels: {
				enabled: false
			},
			gridLineWidth: 0
		},
		legend: {
			enabled: false
		},
		plotOptions: {
			column: {
				stacking: 'normal',
				dataLabels: {
					enabled: false,
				},
				columnrange: {
					grouping: false,
					pointPadding: -0.1
				}
			}
		}
	});
	Highcharts.setOptions({
		lang: {
			thousandsSep: ','
		}
	});
	$('#summary-chart').highcharts({
		series: [{
			name: 'Agent Productivity',
			data: [ap_val],
			pointWidth: 180
		}, {
			name: 'Agent Attrition',
			data: [aa_val],
			pointWidth: 180
		}, {
			name: 'Customer Lifetime',
			data: [cl_val],
			pointWidth: 180
		}],
		colors: ['#009ada', '#ffcf06', '#37b34a'],
		yAxis: {
			max: yaxis_max
		}
	});
	$('#total-savings').show();
}

function makeColorbox() {
	$("#email_form").colorbox({
		inline: true,
		width: "50%"
	});
}
var timerId = null,
	timeout = 5;

function WaitUntilCustomerGUIDIsRetrieved() {
	if (!!(timerId)) {
		if (timeout == 0) {
			return;
		}
		if (typeof this.GetElqCustomerGUID === 'function') {
			document.forms["ROICalculatorcontactliveops"].elements["elqCustomerGUID"].value = GetElqCustomerGUID();
			return;
		}
		timeout -= 1;
	}
	timerId = setTimeout("WaitUntilCustomerGUIDIsRetrieved()", 500);
	return;
}


